import React from 'react';
import { Box, ScrollView, Text } from 'native-base';
import Colors from '../../color';

function Reject() {
  return (
    <Box h="full" bg={Colors.white} pt={5}>
        <ScrollView showsVerticalScrollIndicator={false}>
            <Text>a</Text>
        </ScrollView>
    </Box>
  );
}

export default Reject;
